import Men from "./Men.png";
import Women from "./Women.png";
import Shoes from "./Shoes.png";
import Watch from "./Watch.png";

let ShopCategory = [
    {
      image: Men,
      title: "mens",
    },
    {
      image: Women,
      title: "womens",
    },
    {
      image: Shoes,
      title: "shoes",
    },
    {
      image: Watch,
      title: "watches",
    },
  ];

export default ShopCategory;
